 <section class="desc markdown">
  <p>
   Returns a new set with the the elements of this that are not in
   <code>
    other
   </code>
   .
  </p>
  <p>
   That is, the returned set contains all the elements of this
   <a class="" href="dart-core/Set-class.html">
    Set
   </a>
   that
are not elements of
   <code>
    other
   </code>
   according to
   <code>
    other.contains
   </code>
   .
  </p>
 </section>
